import React from "react";
import "./style.css";

function NewsImage() {
  return (
    <div>
      <img
        src="https://wellnesspractices.blazonco.com/images/news1.jpg"
        className="newsImage"
      ></img>
    </div>
  );
}

export default NewsImage;
